"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([[1832],{64657:t=>{t.exports=JSON.parse('{"name":"Kaniko","url":"https://github.com/woodpecker-ci/plugin-kaniko","description":"Plugin to build container images without root privileges","docs":"<p>Settings can be defined using the <code>settings</code> option for woodpecker plugins. All available settings and their defaults are listed below.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>dry-run</code></td>\\n<td><code>false</code></td>\\n<td>disables docker push</td>\\n</tr>\\n<tr>\\n<td><code>repo</code></td>\\n<td><em>none</em></td>\\n<td>sets repository name for the image (can be a list)</td>\\n</tr>\\n<tr>\\n<td><code>username</code></td>\\n<td><em>none</em></td>\\n<td>sets username to authenticates with</td>\\n</tr>\\n<tr>\\n<td><code>password</code></td>\\n<td><em>none</em></td>\\n<td>sets password / token to authenticates with</td>\\n</tr>\\n<tr>\\n<td><code>registry</code></td>\\n<td><code>https://index.docker.io/v1/</code></td>\\n<td>sets docker registry to authenticate with</td>\\n</tr>\\n<tr>\\n<td><code>dockerfile</code></td>\\n<td><code>Dockerfile</code></td>\\n<td>sets dockerfile to use for the image build</td>\\n</tr>\\n<tr>\\n<td><code>tags</code></td>\\n<td><em>none</em></td>\\n<td>sets repository tags to use for the image</td>\\n</tr>\\n</tbody></table>\\n<h2>Advanced Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>context</code></td>\\n<td><code>.</code></td>\\n<td>sets the path of the build context to use</td>\\n</tr>\\n<tr>\\n<td><code>build-args</code></td>\\n<td><em>none</em></td>\\n<td>sets custom build arguments for the build</td>\\n</tr>\\n<tr>\\n<td><code>build-args-from-env</code></td>\\n<td><em>none</em></td>\\n<td>forwards environment variables as custom arguments to the build</td>\\n</tr>\\n<tr>\\n<td><code>auto-tag</code></td>\\n<td><code>false</code></td>\\n<td>if set generate .tags file, support format Major.Minor.Release or start with <code>v</code> docker tags: Major, Major.Minor, Major.Minor.Release and latest</td>\\n</tr>\\n<tr>\\n<td><code>log-level</code></td>\\n<td><code>info</code></td>\\n<td>set different log level</td>\\n</tr>\\n<tr>\\n<td><code>target</code></td>\\n<td><em>none</em></td>\\n<td>indicate which build stage is the target build stage</td>\\n</tr>\\n<tr>\\n<td><code>cache</code></td>\\n<td><code>false</code></td>\\n<td>use a cache repo</td>\\n</tr>\\n<tr>\\n<td><code>cache-repo</code></td>\\n<td><em>none</em></td>\\n<td>specify the cache repo</td>\\n</tr>\\n<tr>\\n<td><code>cache-ttl</code></td>\\n<td><em>none</em></td>\\n<td>set the time to live for the cache</td>\\n</tr>\\n<tr>\\n<td><code>skip-tls-verify</code></td>\\n<td><code>false</code></td>\\n<td>ignore tls issues</td>\\n</tr>\\n<tr>\\n<td><code>mirrors</code></td>\\n<td><em>none</em></td>\\n<td>set docker hub mirrors</td>\\n</tr>\\n<tr>\\n<td><code>json-key</code></td>\\n<td><em>none</em></td>\\n<td>pass a json key to kaniko</td>\\n</tr>\\n</tbody></table>\\n","tags":["docker","podman","container","build"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-kaniko","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-kaniko","verified":true}')}}]);